(function calculatedFieldValue(current) {

    var full_name = "";
    if (!current.first_name.nil()) {
        full_name += current.first_name;
    }
    if (!current.last_name.nil()) {
        full_name += " " + current.last_name;
    }
    return full_name;

})(current);
